import styled from "@emotion/styled";
import { Typography } from "@mui/material";
import { _colors } from "../../utils/colors";

const Title = styled(Typography)({
  color: _colors.secondary,
  fontFamily: "inherit",
  fontSize: 120,
});

export default Title;
